import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

// import pages
import Demo from './pages/demo.jsx';

export default function App() {
  return (
    <Router>
      <div>
        <Switch>
          <Route path="/demo">
            <Demo />
          </Route>
          <Route path="*">
            <NoMatch />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}
